import Logo from './Components/Logo';
import perfil from './Images/'


const textoOpcoes = ['CATEGORIAS', 'MINHA ESTANTE', 'FAVORITOS', ]
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo className = 'logo' />
        <ul className='opcoes'>
          {textoOpcoes.map(opcao => <li className='opcao'>{opcao}</li>)}
        </ul>
      </header>
    </div>
  );
}

export default App;
